import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import "./App.css";

import { Home, Inventory } from "./pages/index";

const App = () => {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/inventory" element={<Inventory />}></Route>
        </Routes>
      </Router>
    </div>
  );
};

export default App;
